 import {dispatchHelper} from '../utils/utils';
 import {GET_NTOIFICATIONS,CLEAR_NOTIFICATIONS,GET_UNREAD_NOTIFICATIONS} from './types';

 export const getNotifications = () => dispatchHelper(GET_NTOIFICATIONS,'get-notifications');
 export const clearNotifications = () => dispatchHelper(CLEAR_NOTIFICATIONS,'clear-notifiactions');
 export const getUnreadNotifications = () => dispatchHelper(GET_UNREAD_NOTIFICATIONS,'get-unread-notifications');
 export const readNotifications = () => dispatchHelper(READ_NOTIFICATIONS,'read-notifications');
